import React from 'react';

const About = () => {
  return (
    <div style={styles.container}>
      <h1>About Me</h1>
      <p>Hi, I'm Rahul Ranjan, a passionate educator and cloud expert.</p>
    </div>
  );
};

const styles = {
  container: {
    padding: '20px',
    textAlign: 'center',
  },
};

export default About;
